paths='data/images/DiagramOrbit/';
var timeDelay = 10;
var Pix = new Array();
var howMany = 169;
var PicCurrentNum = 1;
var PicCurrent = new Image();
Pix[PicCurrentNum] = paths+nps+'/'+elem+parseInt(PicCurrentNum)+'.png';
PicCurrent.src = Pix[PicCurrentNum];

var  timesx=timeDelay;
var si;
function startPix(nn) {
  if (timesx>=timeDelay) timesx=timeDelay/5;
  if (timesx<=timeDelay) timesx=timeDelay*5;
  elemnt(nn);
  si=setInterval("slideshow()", timesx);
}
//function stopPix(nn) {
//  if (timesx<=timeDelay) timesx=timeDelay*50;
//  elemnt(nn);
//  si=setInterval("slideshow()", 10*timesx);
//  clearInterval(si)
//}

function slideshow() {
  PicCurrentNum++;
  if (PicCurrentNum >= howMany) {
    PicCurrentNum = 1;
  }
  Pix[PicCurrentNum]=paths+nps+'/'+elem+parseInt(PicCurrentNum)+'.png';
  PicCurrent.src = Pix[PicCurrentNum];
  document["ChangingPix"].src = PicCurrent.src;
}

function run(nr){
  if (nr==0)
    nr=1;
  Runthis(nr);
  if (document.getElementById("page1").style.display == "")
     startPix(nr)
  else
     stop(nr)   
  top.content.location.href='data/elements/'+nr+'.htm'

}
function stop(nr){
  Runthis(nr);
  PicCurrent.src='';
  document["ChangingPix"].visibilty='hidden';
  clearInterval(si)
}

//-------------------------------Diagram------------------

function moveover(txt){
  window.status = txt;
  document.title = txt;
}

var picorbit = new Image();

function fillitin(Name, Symbol, AtomicNumber, Shells, NotUp, NotDown, ElConf ){
  moveover(Name);
  document.getElementById('AtomicNumber').innerHTML=AtomicNumber;
  document.getElementById('AtomicName').innerHTML=Name;
  document.getElementById('AtomicSymbols').innerHTML=Symbol;
  document.getElementById('ShellsStructure').innerHTML=Shells;
  document.getElementById('NotationUp').innerHTML=NotUp;
  document.getElementById('NotationDown').innerHTML=NotDown;
  document.getElementById('ElectroConfigur').innerHTML=ElConf;
}

function ShowImg(Images,el,em,en){
  picorbit.src = 'data/images/orbitals/' + Images;
  document['picture'].src = eval("document['picture'].src = " + 'picorbit' + ".src");
  document.BoxNot.e_l.value = el;
  document.BoxNot.e_m.value = em;
  document.BoxNot.e_n.value = en;
}

function dsp(ss,s1){
  if (s1=='on') {
    document.getElementById(ss).style.visibility='visible'
  }
  else 
    if (s1=='off'){
      document.getElementById(ss).style.visibility='hidden'
    }
  else 
    document.getElementById(ss).style.visibility='hidden'
}

